import { useState, useEffect } from "react";

export const Test = () => {
  const [test, setTest] = useState("initial");

  function testFn(data){
    setTest(data)
    console.log(data)
  }
  
  useEffect(() => {
    try {
      fetch("/api", {
        method: "GET",
      })
        .then((res) => console.log(res.json()))
        .then((data) => testFn(data));
    } catch (error) {
      console.log("error =>", error);
    }
  }, []);

  return <h1>Test</h1>;
};
